INSERT INTO `settings` (`id`, `key`, `locale`, `value`, `created_at`, `updated_at`) VALUES
(1, 'terms', 'ar', 's:14260:\"<p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"list-style: none; font-size: 36px;\"><b>شروط عامة</b></span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">1-أقر أنا الموقع بأني قد إستأجرت السيارة الموضح رقمها وموديلها بواجهة العقد ( الحجز ) وهي بحالة سليمة وصالحة للإستعمال وأتعهد بأن أحافظ علي سلامتها وصيانتها .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">2- أتعهد بموجب هذا العقد ( الحجز ) بعدم السماح لأي شخص آخر أن يقودها وإذا شوهد شخص آخر يقودها غير المستاجر بحق المؤسسة أو أي موظفيها سحب السيارة منه وليس للمستأجر الحق بمطالبة المؤسسة بدفع باقي الأجرة مهما كانت وأن أحافظ عليها طيلة إستعمالي لها وأن لا أعرضها للضرر والمخاطر وأن أسير بها السير النظامي والمعقول .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">3- أن أي تعطيل يحصل لسير السيارة نتيجة لمخالفة نظامية إرتكبتها أو صدم أو ما شبه ذلك يلزمني بدفع أجرتها اليومية طيلة مدة تعطيلها عن السير كما أتعهد بتخليص إجراءاتها من قبل المرور أو إدارة حكومية أو ورشة إصلاح وأظل مسؤولا عنها كما لو كانت سيارتي الخاصة حتي عودتها إلي المؤسسة مثلما إستلمتها مهما كلفني ذلك من مراجعتها وغير ذلك.</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">4- في حالة حصول أي حادث يؤدي إلي أضرار بالسيارة أو أي ضرر للغير سواء كانت شخصية أو مادية فإنني مكلف بإتباع الخطوات القانونية التي يجب إتباعها نظاميا في مثل هذه الحالات وذلك بإشعار أقرب مركز شرطة لإجراء التحقيق اللازم وتحديد مسؤلية المتسبب كما لا يجوز لي بأي حال من الأحوال التنازل عن أي حق من حقوقي ضد الشخص المتسبب بالحادث .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">5- في حالة إنتهاء مدة الايجار المتفق عليها في العقد ولم يتم تسليم السيارة من قبل المستاجر تعتبر السيارة مسروقة وللمؤسسة الحق في إتخاذ الإجراءات القانونية .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">6- المسافة المسموح بسيرها خلال أربع وعشرون ساعة هي مـائتان وخمسون كيلو متراُ وما زاد عن ذلك فانني مستعد بمحاسبة المؤسسة بسعر الكيلو متر حسب تسعيرة وزارة المواصلات والسعر موضح بواجهة العقد .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">7- في حالة حدوث أي عطل بماكينة السيارة ناجمة عن سوء إستخدام المستاجر للسيارة يتحمل نفقات إصلاحها كاملة وأيام تعطيلها عن العمل .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">8- يمنع منعا باتا كسر أو العبث بالختم علي العداد المذكور أو التدخل بأي شكل في كيفية عمل العداد وإذا تم العبث بالعداد يتحمل المستاجر تكلفة 500 ريال يوميا غرامة بغض النظر عن الإيجار .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">9- الحد الأدني للإيجار 24 ساعة (يوم واحد) والساعة الزائدة عن ذلك تحتسب 1/5 الأجر اليومي للسيارة .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">10- لايسمح بخروج السيارة من المنطقة الجغرافية للعقد إلا بعد الحصول علي تصريح بذلك خطياً وسوف يتحمل العميل شحن السيارة من أي فرع أخر الي الفروع المستأجرة منه بسعر مختلف حسب المنطقة المتجه إليها المستأجر:</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">11- المؤسسة غير مسئولة عن أي مفقودات داخل السيارة بعد تسليمها .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"list-style: none; font-weight: 700; font-size: 24px;\">12- التأمين علي السيارة :</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">1 / 12 – شركة التأمين لا تعتمد تغطية المسؤولية من قبل المستأجر في حالة إنتهاء مدة الإيجار المدونة في العقد أو خروج السيارة من مدينة المنطقة الجغرافية للعقد أو كان يقود السيارة شخص أخر غير المستاجر أو الصدام في أجسام ثابتة .</span><br style=\"list-style: none;\"><span style=\"font-size: 24px;\">2 / 12 – في حالة تغطية شركة التأمين للحادث يتحمل المستأجر للسيارة قسط التامين وقدره 1500 ريال للسيارات الصغيرة ، 2000 ريال للسيارات الوسط و 3000 ريال للسيارات العائلية والفخمة بالإضافة الي 20% من قيمة قطع الغيار وعطلة السيارة أثناء الإصلاح بالكامل .</span><br style=\"list-style: none;\"><span style=\"font-size: 24px;\">3 / 12 – التأمين لا يشمل مصاريف سحب السيارة المصدومة للورشة ولا مصاريف إستهلاك السيارة المصدومة والقيادة في حالة سكر أو الإهمال المتعمد أو الهروب من موقع الحادث وتقرير المرور هو الوثيقة الوحيدة الي تحدد مسؤلية الحادث .</span><br style=\"list-style: none;\"><span style=\"font-size: 24px;\">4 / 12 – شركة التأمين لا تعتمد تغطية المسئولية الناتجة عن أى حادث من قبل المستأجر إلا بعد الحصول على تقرير مفصل من المرور وورقة إصلاح ولا يحق للعميل التنازل فى موقع الحادث حتى لا يتعرض لتحمل كافة مصاريف إصلاح السيارة .</span><br style=\"list-style: none;\"><span style=\"font-size: 24px;\">5 / 12 – فى حالة السيارة فى وضع التشغيل يعتبر ذلك إهمالاً ويتحمل المستأجر قيمة السيارة وكذلك قيمة الإيجار المتأجر و الأضرار عن الفترة من تاريخ سرقة السيارة حتى تاريخ سداد قيمتها .</span><br style=\"list-style: none;\"><span style=\"font-size: 24px;\">6/ 12 – فى حالة التأخر فى تسليم السيارة لمدة تزيد عن أربع وعشرون ساعة من الموعد المحدد , فإنه يحق للشركة إخطار الجهات المعنية بذلك .</span><br style=\"list-style: none;\"><span style=\"font-size: 24px;\">7 / 12 -مازاد عن خمسة ساعات تأخير يعتبر يوم كامل , وأقل مدة تأجير يوم , وفى حالة تجاوز المستأجر المدة المحددة بالعقد , لا يحق له طلب تخفيض السعر المحدد بالعقد .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">13- في حالة حجز السيارة من قبل الإدارات الحكومية أو إدارة مكافحة المخدرات أو إدارة المرور أو المخالفات الجسيمة فإن المستأجر مسؤول مسؤولية كاملة عن قيمة الإيجار حتي خروج السيارة من حجزها .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">14- شركة التأمين لا تعتمد تغطية الحوادث في حالة المخالفات المرورية الجسيمىة (قطع إشارة – عكس سير – سرعة زيادة ) .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">15- إذا كان سن المستأجر أقل من 25 سنة السيارة لا يشملها التأمين وكذلك في حالة إنتهاء مدة العقد أو التمديد لا تشملها التأمين .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">16- في حاله ترك السيارة أمام مكتب المؤسسة فإن المؤسسة غير مسئولة عن السيارة والمستأجر يتحمل ما يترتب عليها من إيجار .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">17- في حالة سحب السيارة وهي في حوزة المستأجر عن طريق المرور او الشرطة لكونها في وضع مخالف يتحمل المستأجر إيجار السيارة وما عليها من مخالفات لحين إطلاقها .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">18- السيارة مسئولية المستأجر وفي حالة سرقتها وهي في وضع التشغيل لا يشملها التأمين كما أن سرقة أي شيء من السيارة لا يشمله التأمين ويتحمله المستأجر .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">19- الخصم الممنوح للسيارة لا يشمل المدة الزائدة عن مدة العقد ولا يسحب إلا في حالة التجديد أو التمديد .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">20- أتعهد بأن أسلم السيارة بكامل مستحقاتها .</span></p><p style=\"font-family: &quot;JF Flat Regular&quot;, sans-serif; list-style: none; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-size: 14px; text-align: start;\"><span style=\"font-size: 24px;\">** – المكتب الرئيسي ومكاتب المطارات تعمل 24 ساعة .</span></p>\";', '2021-03-25 07:20:18', '2021-04-18 09:24:33'),
(2, 'terms', 'en', 's:452:\"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Curabitur non nulla sit amet nisl tempus convallis quis ac lectus. Mauris blandit aliquet elit, eget tincidunt nibh pulvinar a. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Donec velit neque, auctor sit amet aliquam vel, ullamcorper sit amet ligula. Cras ultricies ligula sed magna dictum porta.\";', '2021-03-25 07:20:18', '2021-03-25 07:20:18'),
(3, 'privacy', 'ar', 's:1144:\"<b><span style=\"color: rgb(51, 51, 51); font-size: 18px;\" droid=\"\" arabic=\"\" kufi\",=\"\" serif;=\"\" font-size:=\"\" 12px;=\"\" text-align:=\"\" justify;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">تلتزم شركة أبو ذياب بتوفير نفس الموديل وسنة الصنع التي قمت باختيارها وقت الحجز و في حال عدم توفر السيارة المختارة عند تنفيذ الحجز تلتزم&nbsp;</span><span style=\"color: rgb(51, 51, 51); font-size: 18px;\" droid=\"\" arabic=\"\" kufi\",=\"\" serif;=\"\" font-size:=\"\" 12px;=\"\" text-align:=\"\" justify;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">شركة أبو ذياب&nbsp;</span><span style=\"color: rgb(51, 51, 51); font-size: 18px;\" droid=\"\" arabic=\"\" kufi\",=\"\" serif;=\"\" font-size:=\"\" 12px;=\"\" text-align:=\"\" justify;=\"\" background-color:=\"\" rgb(238,=\"\" 238,=\"\" 238);\"=\"\">بتوفير سيارة من نفس الفئة ونفس سنة الصنع او سنة صنع اعلى، وفي حال عدم توفر سيارة من نفس الفئة يتم الترقية لفئة اعلى بدون اي تكاليف أضافية .</span></b>\";', '2021-03-25 07:20:18', '2021-04-18 11:19:27'),
