(5, 'about', 'ar', 's:3460:\"<div class=\"main-title\" style=\"font-family: \" jf=\"\" flat=\"\" regular\",=\"\" sans-serif;=\"\" list-style:=\"\" none;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" font-size:=\"\" 14px;=\"\" text-align:=\"\" start;=\"\" background-color:=\"\" rgb(228,=\"\" 228,=\"\" 228);\"=\"\"><h4 class=\"title wow fadeInDown\" data-wow-duration=\"1s\" data-wow-delay=\"0.5s\" style=\"list-style: none; font-weight: bold; line-height: 1.1; margin-top: 10px; margin-bottom: 40px; font-size: 32px; text-transform: capitalize; animation-name: fadeInDown; text-align: center; visibility: visible; animation-duration: 1s; animation-delay: 0.5s;\"><font color=\"#ff0000\" style=\"\"> تعد شركةأبو ذياب لتأجير السيارات أول شركات تأجير السيارات في المملكة العربية السعودية. تأسست عام 1386 هـ في المملكة العربية السعودية على يد مؤسسها الشيخ \"محمد حسين ابو ذياب\" وتصدرت المشهد في تلك الأعوام حتي تربعت على عرش سوق تأجير السيارات بالمملكة. وتتواجد الشركة في أكبر المناطق الحيوية في المملكة وفي المطارات الدولية مثل \'جدة - الرياض - الدمام - الخبر - خميس مشيط\' .</font></h4><p style=\"list-style: none; line-height: 1.1; margin-top: 10px; margin-bottom: 40px; font-size: 32px; text-transform: capitalize; animation-name: fadeInDown; text-align: center; visibility: visible; animation-duration: 1s; animation-delay: 0.5s;\"><b style=\"\"><font color=\"#ff0000\"><span style=\"\" jf=\"\" flat=\"\" regular\",=\"\" sans-serif;=\"\" font-size:=\"\" 24px;=\"\" text-align:=\"\" start;=\"\" text-transform:=\"\" none;=\"\" background-color:=\"\" rgb(0,=\"\" 255,=\"\" 0);\"=\"\"><u>أهدافنا : </u></span></font></b></p><p style=\"list-style: none; line-height: 1.1; margin-top: 10px; margin-bottom: 40px; font-size: 32px; text-transform: capitalize; animation-name: fadeInDown; text-align: center; visibility: visible; animation-duration: 1s; animation-delay: 0.5s;\"><b style=\"\"><font color=\"#ff0000\" style=\"\"><span style=\"\" jf=\"\" flat=\"\" regular\",=\"\" sans-serif;=\"\" font-size:=\"\" 24px;=\"\" text-align:=\"\" start;=\"\" text-transform:=\"\" none;=\"\" background-color:=\"\" rgb(0,=\"\" 255,=\"\" 0);\"=\"\">الحرصً على مواكبة أحدث التطورات والخدمات في سوق تأجير السيارات توفير تشكيلة متنوعة من أحدث السيارات والموديلات العالمية من جميع الأنواع والفئات وبأسعار مناسبة مع تقديم خدمات متميزة.</span><br style=\"font-family: \" jf=\"\" flat=\"\" regular\",=\"\" sans-serif;=\"\" list-style:=\"\" none;=\"\" font-size:=\"\" 14px;=\"\" text-align:=\"\" start;=\"\" text-transform:=\"\" background-color:=\"\" rgb(235,=\"\" 235,=\"\" 235);\"=\"\"><span style=\"\" jf=\"\" flat=\"\" regular\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" text-align:=\"\" start;=\"\" text-transform:=\"\" none;=\"\" background-color:=\"\" rgb(235,=\"\" 235,=\"\" 235);\"=\"\">إ</span><span style=\"\" jf=\"\" flat=\"\" regular\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" text-align:=\"\" start;=\"\" text-transform:=\"\" none;=\"\" background-color:=\"\" rgb(235,=\"\" 235,=\"\" 235);\"=\"\">نشاء علاقات إستراتيجية بين شركة أبو ذياب لتأجير السيارات ووكلاء السيارات في المملكة، للدفع بأسطول متنوع من السيارات بالفروع.</span></font></b><br></p></div>\";', '2021-03-25 07:20:19', '2021-04-18 09:29:04'),
